import CIcon from "@coreui/icons-react";
import { CDropdown, CDropdownDivider, CDropdownItem, CDropdownMenu, CDropdownToggle,
  CBadge,

  CImg
} from "@coreui/react";
import TableCard from "src/views/table/TableCard";
import './style.css';
const SubmitedTask = ()=>{

  const Buttons =()=>{
      return  <>
                <div id="div1">
      <div id="rock1"></div>
      <div id="rock2"></div>
      <div id="rock3"></div>
      <div id="rock4"></div>
      <div id="rock5"></div>
      <div id="rock6"></div>
      <div id="rock7"></div>
      <div id="rock8"></div>
      <div id="diva1">
        <img id="img1" src="https://image.flaticon.com/icons/png/512/78/78075.png"/>
        <div id="divaa1">
          <input id="btna1" type="button" value="Theme"/>
          <input id="btna2" type="button" value="Profile"/>
          <input id="btna3" type="button" value="More"/>
          <img id="img2" src="https://upload.wikimedia.org/wikipedia/commons/thumb/6/6d/Windows_Settings_app_icon.png/768px-Windows_Settings_app_icon.png"/>
          <div id="divaaa1"></div>
        </div>
        <div id="divaa2">
          <img id="img3" src="https://openclipart.org/image/2400px/svg_to_png/399/molumen-phone-icon.png"/>
          <div id="divaaa2"></div>
          <input id="btnb1" type="button" value="Phone"/>
          <input id="btnb2" type="button" value="Call"/>
        </div>
        <div id="divaa3">
          <input id="btnc1" type="button" value="About"/>
          <input id="btnc2" type="button" value="Creator"/>
          <input id="btnc3" type="button" value="More"/>
          <img id="img3" src="https://image.flaticon.com/icons/svg/32/32175.svg"/>
          <div id="divaaa3"></div>
          <div id="divaaa4"></div>
        </div>
      </div>
    </div>
              </>
  }
    const columns = [
        {
          dataField: "#taskId",
          text: "#taskId",

        },
        {
          dataField: "title",
          text: "Title",

          sort: true
        },
        {
          dataField: "writerName",
          text: "Writer Username",

        },
        {
          dataField: "email",
          text: "email",

        },
        {

            dataField: "status",
            text: "status",


        },
        {

            dataField: "category",
            text: "Category",


        },
        {

          dataField: "sdate",
          text: "Submited-Date",


      },
      {

        dataField: "ddate",
        text: "Deadline",


      },
        {
            dataField: "Action",
            text: "Action",

          }
      ];
      const products=[
            {
              "#taskId":"884747",
              title:"HHggggg",
              writerName:"Airo",
              email:"airotony8@gmail.com",
              status:"status",
              category:"Category",
              sdate:"2018-9-10",
              ddate:"2020-8-10",
              Action:Buttons()

            }

      ]
    return <>
             <TableCard 
             products={products}
             columns={columns}
              title={"NEW TASK SUBMITED"}
             />
          </>
}

export default SubmitedTask;
